import React from "react";
import styled from "styled-components";
import ContentsBox1 from "./imageSliderContents/ContentsBox1";
import ContentsBox2 from "./imageSliderContents/ContentsBox2";
import ContentsBox3 from "./imageSliderContents/ContentsBox3";

const Container = styled.div``;

const LinkedContents = () => {
  return (
    <Container>
      {" "}
      <ContentsBox1 />
      <ContentsBox2 />
      <ContentsBox3 />
    </Container>
  );
};

export default LinkedContents;
